import './App.css';
import React, {  useState,useEffect } from "react";
import Axios from 'axios';
import { useParams,} from "react-router-dom";





function App() {

let {postId} = useParams();
const [post,setPost] = useState({});

const [resumeid,id] = useState('');
const [resumename,name1] = useState('');
const [resumeus,usn] = useState('');
const [resumehdeg,hdeg] = useState('');
const [resumejtype,jtype] = useState('');
const [resumejdic,jdisc] = useState('');
const [resumesslcp,sslcp] = useState('');
const [resumesslcins,sslcins] = useState('');
const [resumepucp,pucp] = useState('');
const [resumepuci,puci] = useState('');
const [resumedeg,deg] = useState('');
const [resumedegp,degp] = useState('');
const [resumedegi,degi] = useState('');




var pen = document.getElementById(id.value);

useEffect(()=>{
  Axios.get(`http://localhost:3001/api/${postId}`).then((data)=>{
      console.log(data)
  setPost({

           usn: data.data[0].usn,
           name: data.data[3].name,
           id:data.data[3].id
          });
   });

  },[postId]);

const submitReview=()=>{
  Axios.post("http://localhost:3001/", {
    resumeid: resumeid, 
    resumename: resumename,
    resumeus: resumeus,
    resumehdeg: resumehdeg,

}).then(()=> {
  alert("sucessfully inserted")

});
};





  return (
    <div id='main'>

      <div><h1>RESUME BUILDER</h1></div>
      <div>
        <form><table><tr><td>
        <label>ID</label></td><td>
        <input type="text" name="hdeg" id ="tf" onChange={(e)=>{
          hdeg(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>USN</label></td><td>
        <input type="text" name="usn" id ="tf" onChange={(e)=>{
          usn(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>NAME</label></td><td>

        <input type="text" name="name1" id ="tf" onChange={(e)=>{
          name1(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label></label></td><td>
        <input type="text" name="jtype" id ="tf" onChange={(e)=>{
          jtype(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>USN</label></td><td>
        <input type="text" name="jdisc" id ="tf" onChange={(e)=>{
          jdisc(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>NAME</label></td><td>

        <input type="text" name="sslcp" id ="tf" onChange={(e)=>{
          sslcp(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>ID</label></td><td>
        <input type="text" name="sslcins" id ="tf" onChange={(e)=>{
          sslcins(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>USN</label></td><td>
        <input type="text" name="pucp" id ="tf" onChange={(e)=>{
          pucp(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>NAME</label></td><td>

        <input type="text" name="puci" id ="tf" onChange={(e)=>{
          puci(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>ID</label></td><td>
        <input type="text" name="deg" id ="tf" onChange={(e)=>{
          deg(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>USN</label></td><td>
        <input type="text" name="degp" id ="tf" onChange={(e)=>{
          degp(e.target.value)
        }}/></td></tr>
        <tr><td>
        <label>NAME</label></td><td>

        <input type="text" name="degi" id ="tf" onChange={(e)=>{
          degi(e.target.value)
        }}/></td></tr></table>

        <button onClick={submitReview}>SUBMIT

        </button></form><br/>

        {post.usn}<br/> {post.id}<br/> {post.name}<br/>
      </div>




    </div>


  );
}

export default App;
